Actionscript.script:
_parent.UpdateBigSmallState("技能中","重力井中");
if(_root.技能浮空 == true and _parent._name == _root.gameworld[_root.控制目标]._name)
{
   if(_root.gameworld[_root.控制目标].Z轴坐标 - _root.gameworld[_root.控制目标]._y >= 30)
   {
      this.onEnterFrame = function()
      {
         if(_root.gameworld[_root.控制目标].Z轴坐标 - _root.gameworld[_root.控制目标]._y >= 30)
         {
            _parent.垂直速度 += 20;
            _root.gameworld[_root.控制目标]._y += _parent.垂直速度;
            if(_root.gameworld[_root.控制目标]._y > _root.gameworld[_root.控制目标].Z轴坐标)
            {
               _root.gameworld[_root.控制目标]._y = _root.gameworld[_root.控制目标].Z轴坐标;
            }
            stop();
         }
         else
         {
            if(_parent.flySpeed > 0)
            {
               _parent.flySpeed = 0;
            }
            play();
            delete this.onEnterFrame;
         }
      };
   }
}

_parent.UpdateBigSmallState("技能结束","重力井结束");
//_parent.动画完毕();
_root.技能路由.动画完毕(this,_parent);

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   var temp = _parent._parent.mp * 0.5;
   子弹威力 = (_parent._parent.空手攻击力 + 50) * (2 + _parent._parent.技能等级 * 0.5) + temp;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 300;
   击倒率 = 0.01;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

